import React, { Component } from 'react';
// import { connect } from 'react-redux';


class RoommateTable extends Component {
    constructor() {
        super()
        this.state = {}
    }

    render(){
        return(
            <table className = "highlight centered bordered">
        <thead>
          <tr>
              <th>First Name</th>
              <th>Last Name</th>
              <th>Email</th>
              <th>Edit</th>
              <th>Delete</th>
          </tr>
        </thead>
        <tbody>

        </tbody>
      </table>
        )
    }
}

export default RoommateTable
